INSERT INTO winworld.Screenshots (ScreenshotUUID, ReleaseUUID, ScreenshotTitle, ScreenshotFile) VALUES (0xC2A8C3984DC2B2C3A13A11C3A6C2BB2A, 0x2126C3B0C5B82E3911C3A4E284A2C3A5, 'The welcome screen detailing sources and such. Other non-person or film articles will be in this.', '97-c4b12e47fe5b7d7ec7cdd18ca55286bc-CinemaniaWelcomeScreen.png');
INSERT INTO winworld.Screenshots (ScreenshotUUID, ReleaseUUID, ScreenshotTitle, ScreenshotFile) VALUES (0xC384C290281FC3A13A11C3A6C2BB2A52, 0x2126C3B0C5B82E3911C3A4E284A2C3A5, 'The page for "Twin Peaks: Fire Walk with Me." In this case, there aren''t many extras such as clips, just barebones details about the film and a review.', '97-4d8e4fc05990188c1182614af15d5e0c-CinemaniaMovieScreen.png');
INSERT INTO winworld.Screenshots (ScreenshotUUID, ReleaseUUID, ScreenshotTitle, ScreenshotFile) VALUES (0xC3A521C2A47BC3A13A11C3A6C2BB2A52, 0x2126C3B0C5B82E3911C3A4E284A2C3A5, 'A more dense entry, for the film "Blue Velvet." In this case, there''s more reviews, stills, clips, and even articles explaining the film.', '97-a17e0b20aa43561518b4053ae198d0d8-CinemaniaMoreDenseScreen.png');
INSERT INTO winworld.Screenshots (ScreenshotUUID, ReleaseUUID, ScreenshotTitle, ScreenshotFile) VALUES (0xC3BDC391C39BC397C3A13A11C3A6C2BB, 0x2126C3B0C5B82E3911C3A4E284A2C3A5, 'The entry for David Byrne. A picture is provided, and articles about other persons can include clips.', '97-b5464c77de8031a2cfcf26abd2031416-CinemaniaPersonScreen.png');
INSERT INTO winworld.Screenshots (ScreenshotUUID, ReleaseUUID, ScreenshotTitle, ScreenshotFile) VALUES (0x21464628C3A13B11C3A6C2BB2A525400, 0x2126C3B0C5B82E3911C3A4E284A2C3A5, 'A gallery exists to browse the multimedia included in Cinemania.', '97-5f8903b6ed848aad5dfb6ac503d320f6-CinemaniaGalleryScreen.png');
