INSERT INTO winworld.Screenshots (ScreenshotUUID, ReleaseUUID, ScreenshotTitle, ScreenshotFile) VALUES (0x461DC3AD34C3A13B11C3A6C2BB2A5254, 0x2126C3B0C5B82E3911C3A4E284A2C3A5, 'Tours show you curated and specific parts of film. Very kino.', '97-0d674744e99739291e5764ac7992bf1f-CinemaniaTourScreen.png');
INSERT INTO winworld.Screenshots (ScreenshotUUID, ReleaseUUID, ScreenshotTitle, ScreenshotFile) VALUES (0x59E280BA790EC3A13B11C3A6C2BB2A52, 0x2126C3B0C5B82E3911C3A4E284A2C3A5, 'The search feature can be used to drill down in various categories, and randomly suggest films for you.', '97-4a8a87c1916de020a8a53e4a26cf7ff8-CinemaniaSearchScreen.png');
